import React, {useEffect, useState} from 'react'
var jack = ["hello", "hello"]
function App(){

  const [backendData, setBackendData] = useState([])

  useEffect(() => {
    fetch("/api")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setBackendData(data)
      })
  }, [])

  return (
    <div>
      {backendData}
      <Container>
        <h1>Powerlifting Meets</h1>
        <Form>

        </Form>
      </Container>
    </div>
  )
}


export default App
